import "./InspirationsList.css";
import InspirationItem from "./InspirationItem";

function InspirationsList(props) {
    if(props.items.length === 0) {
        return <h2 className="expenses-list__fallback">No Inspiration.</h2>
    }
    return <div className="expenses-list">
        {props.items.map(inspiration => (
            <div>
                <InspirationItem 
                key={inspiration.id}
                title={inspiration.inspirationTitle} 
                link={inspiration.inspirationLink}
                comment={inspiration.inspirationComments}
                tags={inspiration.inspirationTags}
            />
            </div>

        ))}
    </div>
}

export default InspirationsList;
